// JavaScript Document
import React, {Component} from 'react';

const ActiveThumbnailWindow = ({activeThumbnail}) => {
		return(
			<div style={styles.container}> 
			<img src={activeThumbnail.url} style={{width: '100%'}}/>
			</div>
		)
	}

export default ActiveThumbnailWindow
const styles ={
container : {
	background: '#333',
	height: '55%',
	width: '100%',
	position:'relative'
},
}
